import React from "react";
import "../../styles/frndPop.css";

export default function FriendList() {
  return (
    <aside className="friend-list">
      <h4>Friends</h4>
      <ul>
        <li>Alex</li>
        <li>Jamie</li>
        <li>Priya</li>
      </ul>
    </aside>
  );
}
